import { Spacer, Card, Text } from "@nextui-org/react";
import { tStudentResultado, tStudentFormula } from "./tStudent";
export default function Result({ result }) {
    console.log(result)
    return (
        <Card css={{ mw: "400px" }}>
            <Card.Body>

                <Text h1 size={40}
                    css={{
                        textGradient: "45deg, $blue600 -20%, $pink600 50%",
                    }}
                    weight="bold">Resultado</Text>
                <Spacer y={1} />
                {Object.keys(result).length !== 0 ? (
                    <Text blockquote>Se resuelve con {result.N <= 30 ? "T de Student" : "Distribucion Normal"} <hr />
                        <Spacer y={1} /> {tStudentFormula(result.media, result.desvio, result.N, result.confianza)} <br/>
                        <Text size="$xs">{tStudentResultado(result.media, result.desvio, result.N, result.confianza)}</Text>
                        </Text>)
                    : (<Text blockquote>Completar datos.</Text>)}
            </Card.Body>
        </Card>
    )
}
